import React, { Component } from 'react'; 
import DailyGoalDisplay from './DailyGoalDisplay';
import ForestDisplay from './ForestDisplay';
import './index.css';

export default class ForestContent extends Component {
    render() {
        return(
                <div className="col-sm-12 col-md-6 col-lg-7">
                    <section className="forest-page">
                        <DailyGoalDisplay goal={this.props.user.goal} />
                    </section>   

                    <section>
                        <ForestDisplay time={this.props.user.time} treeNum={this.props.user.treeNum} treeImg={this.props.user.treeImg} flowerNum={this.props.user.flowerNum}/>
                    </section>
                </div>
        )
    }
}
